import React from 'react';
import Carousel from 'react-multi-carousel';
// import '../styles/CategoryButtons.css';
import 'react-multi-carousel/lib/styles.css'; // Ensure to import Carousel styles

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5,
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3,
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2,
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1,
  },
};



const images = [
  '../images/birds/parrot2.jpeg',
  '../images/cats/cat1.jpg',
  '../images/fishes/greenarowana1.jpeg',
  '../images/birds/parrot1.jpg.jpg',
  '../images/dogs/dog2.jpg.jpg',
  // Add more image paths as needed
];


const CategoryButtons = () => {
  return (
    <Carousel 
      responsive={responsive}
      ssr // means to render carousel on server-side for SEO
      infinite // enables infinite loop for the carousel
      autoPlay // enables autoplay for the carousel
      autoPlaySpeed={3000} // delay in ms between auto plays
      keyBoardControl // enables keyboard navigation
      customTransition="all .5" // custom transition effect
      transitionDuration={500} // transition animation duration
    >
      {images.map((image, index) => (
        <div key={index} style={{ position: 'relative' }}>
          <img
            src={image}
            alt={`Slide ${index + 1}`}
            style={{ width: '50px', height: 'auto' }} // You can control the size here
          />
        </div>
      ))}
    </Carousel>
  );
};

// Decide which component you want to export by default, you cannot have two default exports.
export default CategoryButtons;
// If you need to export CategoryButtons as well, use named export
// export { CategoryButtons };
